import React, { Component } from 'react'
class AdminLogin extends Component {
    constructor() {
        super();
        this.state = {
            uname: '',
            pword: ''
        };
    }
    onChange = (e) => {
        this.setState({ [e.target.name]: e.target.value });
    }
    render() {
        const {uname,pword} = this.state;
        return (

            <div class="row">
                <div class="col s12 m8 l4 offset-m2 offset-l4">
                    <div class="card">

                        <div class="card-action teal lighten-1 white-text">
                            <h3>Login Form</h3>
                        </div>

                        <div class="card-content">
                            <div class="form-field">
                                <label for="username">Username</label>
                                <input type="text" name="uname" value={uname} />
                            </div><br/>

                                <div class="form-field">
                                    <label for="password">Password</label>
                                    <input type="password" id="password" name="pword" value={pword} />
                                </div><br/>

                                    <div class="form-field">
                                        <input type="checkbox" id="remem" />
                                        <label for="remem">Rememeber me</label>

                                    </div><br/>

                                    <div class="form-field">
                                        <button class="btn-large waves-effect waves-dark" >Login</button>
                                    </div><br/>
                        </div>

                    </div>
                </div>
            </div>
            
        );
    }

}
export default AdminLogin;
